	let canvas = document.getElementById("canvas");
	let ctx = canvas.getContext("2d");
	let width = canvas.width;
	let height = canvas.height;
	let halfWidth = width / 2;
	let halfHeight = height / 2;
	
	let interval = 1;
	let innerIntervalCallback;
	
	let xOffset = 20;
	let yOffset = 20;
	let side = 28;
	let gridHeight = (height - yOffset * 2);
	let cellHeight = gridHeight / side;
	let cellWidth = cellHeight;
	let dragged;
	let changed;
	let mode;
		
	let data = [];
	let guess = [];
	let nnet;
		
	let refresh = function() {
		
		ctx.strokeStyle = "darkgrey";
		ctx.fillStyle = "black";	
		ctx.clearRect(0, 0, width, height);
		ctx.strokeRect(0, 0, width, height);
	
		for (let y = 0; y < side; y++) {		
			for (let x = 0; x < side; x++) {		
				let index = y * side + x;			
				let cx = xOffset + x * cellWidth;
				let cy = yOffset + y * cellHeight;
				ctx.strokeRect(cx, cy, cellWidth, cellHeight);
				if (data[index] == 1)
					ctx.fillRect(cx, cy, cellWidth, cellHeight);
			}
		}
			
		ctx.textAlign = "left";
		let xStart = xOffset * 2 + side * cellWidth;
		let textOffset = 38;
		let barXOffset = 25;
		let barHeight = 20;
		let barYStep = (gridHeight / 19) * 2;
		let maxBarWidth = width - (side * cellWidth + xOffset * 2 + barXOffset * 2);
		for (let i = 0; i < 10; i++) {
			let barX = xStart + barXOffset;
			let barY = yOffset + barYStep * i;
			ctx.fillRect(barX, barY, maxBarWidth * guess[i], barHeight);
			ctx.strokeRect(barX, barY, maxBarWidth, barHeight);
			ctx.fillText(i, xStart, barY + 14);	
		}
	
	};

	let innnerChangeInterval = function(value) {
		if (isNaN(value))
			return;
		let newValue = Number(value);
		if (newValue < 1)
			return;
		console.log("interval changed from '" + interval + "' to '" + newValue + "'");
		interval = newValue;
		
		if (innerIntervalCallback) 
			clearInterval(innerIntervalCallback);
		
		innerIntervalCallback = setInterval(function() {
			refresh();
		}, interval);
	};

	let innerStart = function() {
		ctx.font = "15px Monospace";
	
		// init pole
		for (let y = 0; y < side; y++) {
			for (let x = 0; x < side; x++) {
				let index = y * side + x;
				data[index] = 0;
			}
		}
	
		let layersSizes = [side * side];

		let chunks = config.split(";");
		let index = 0;
		let layersCount = Number(chunks[index++]);
		for (let l = 1; l < layersCount; l++) {
			layersSizes[l] = Number(chunks[index++]);
		}
		
		nnet = new $.GJSLibNeuralNet(layersSizes, $.GJSLibNeuralNet.sigmoid());
		
		for (let l = 1; l < layersCount; l++) {
			let weights = chunks[index++].split(",");
			for (let w = 0; w < weights.length; w++)
				weights[w] = Number(weights[w]);
			let biases = chunks[index++].split(",");
			for (let b = 0; b < biases.length; b++)
				biases[b] = Number(biases[b]);
			nnet.setWeights(l, $.GJSLibMatrix.fromFlatArray(layersSizes[l], layersSizes[l - 1], weights));
			nnet.setBiases(l, $.GJSLibMatrix.fromFlatArray(layersSizes[l], 1, biases));
		}		
		
		innnerChangeInterval(interval);	
	};
	
	let paint = function(e) {
		let bound = canvas.getBoundingClientRect();
		let x = e.clientX - bound.x;
		let y = e.clientY - bound.y;
		
		let cx = Math.floor((x - xOffset) / cellWidth);
		let cy = Math.floor((y - yOffset) / cellHeight);
		if (cx < 0 || cx >= side || cy < 0 || cy >= side)
			return;
		
		let index = cy * side + cx;
			
		if (changed) {
			mode = data[index] == 1 ? 0 : 1;
			changed = false;
		}
		
		data[index] = mode;
		guess = nnet.guess(data);
	}
	
	canvas.addEventListener("mousedown", function (e) {
		dragged = true;
		changed = true;
		paint(e);
	}, false);
 
	canvas.addEventListener("mouseup", function (e) {
		dragged = false;
	}, false);
	
	canvas.addEventListener("mouseleave", function (e) {
		dragged = false;
	}, false);
	
	canvas.addEventListener("mousemove", function (e) {
		if (!dragged) 
			return;
		paint(e);
	}, false);
	
	return {
	
		start: function() {			
			innerStart();
		},
		
	};
})();

$.nnet.start();
</script>
